import React from 'react';

//about section in Home page, updaing my favorite repos and resize fonmat to display in client
const projectContent = () => {
  return (
    <div className='project__content'>
      <ul>
        <li>
          <a className='project__item--big'>onlene-store</a>
        </li>
        <li>
          <a className='project__item--small'>dev-social-network-community</a>
        </li>
      </ul>
    </div>
  );
};

export default projectContent;
